    private HubConnection hubConnection;
    [Parameter] public int MutualConnections { get; set; }
    [Parameter] public User Model { get; set; }
    [Parameter] public Profile Profile { get; set; }
    [Parameter] public EventCallback<string> OnAcceptRequestCallBack { get; set; }

    private ConnectionRequest_ClientService RequestService { get; set; }
    private ConnectionRequest RequestModel = new ConnectionRequest();
    private User_ClientService UserService { get; set; }


    protected override async Task OnInitializedAsync()
    {
        hubConnection = new HubConnectionBuilder()
            .WithUrl(EngineServices.MarketNetwork.EndPoint + "/notificationhub").Build();

        await hubConnection.StartAsync();
    }

    Task SendAcceptedNotification() => hubConnection.SendAsync("SendNotification", loginService.LoggedInUser.Id, loginService.LoggedInUser.Name + "  Is Now Your Connection.");

    public bool IsConnected => hubConnection.State == HubConnectionState.Connected;

    protected async void AcceptRequestAsync()
    {
        try
        {
            RequestService = new ConnectionRequest_ClientService(EngineServices.MarketNetwork);
            RequestModel.FromUserId = Model.Id;
            RequestModel.ToUserId = loginService.LoggedInUser.Id;
            RequestModel.Status = "Accepted";
            var result = await RequestService.AcceptOrRejectConnectionRequestAsync(RequestModel);
            if (result == true)
            {
                //UserService.UpdateUserCache(Model);
                await OnAcceptRequestCallBack.InvokeAsync(Model.Id);
                if (IsConnected) await SendAcceptedNotification();
                ToastService.ShowSuccess("Connection Request Accepted..!", "Accepted");
            }
            else
            {
                ToastService.ShowError("Unble To Respond Request!", "Error");
            }

        }
        catch (Exception ex)
        {
            SLog.Write(ex.Message);
        }

    }

    protected async void RejectConnectionRequest()
    {
        RequestService = new ConnectionRequest_ClientService(EngineServices.MarketNetwork);
        RequestModel.FromUserId = Model.Id;
        RequestModel.ToUserId = loginService.LoggedInUser.Id;
        RequestModel.Status = "Rejected";
        var result = await RequestService.AcceptOrRejectConnectionRequestAsync(RequestModel);
        if (result == true)
        {
            await OnAcceptRequestCallBack.InvokeAsync(Model.Id);
            ToastService.ShowSuccess("Connection Request Rejected..!", "Rejected");
        }
        else
        {
            ToastService.ShowError("Unble To Respond Request!", "Error");
        }

    }


    public void Dispose()
    {
        _ = hubConnection.DisposeAsync();
    }

